import React from 'react';
import './css/topBar.css';

function Nav() {
    return (
        <header className="header">
            <div className="topContainer">
                <div className="title">
                    <h1>예약하자</h1>
                </div>
                <div className="top-bar">
                    <a className="topText" href="/">
                        로그인
                    </a>
                    <a className="topText" href="/">
                        회원가입
                    </a>
                </div>
            </div>
        </header>
    );
}

export default Nav;
